import Index from "../views/Index";
import Food from '../views/Food';
import Store from '../views/Store';
import SearchResult from '../views/SearchResult';
import CustomOrder from '../views/CustomOrder';
import CustomResult from '../views/CustomResult';
import ListViewDemo from '../views/Demos/ListViewDemo';
var indexRoutes = [
  { path: "/listviewdemo", name: "ListViewDemo", component: ListViewDemo },
  { path: "/customresult", name: "CustomResult", component: CustomResult },
  { path: "/customorder", name: "CustomOrder", component: CustomOrder },
  { path: "/search", name: "Search", component: SearchResult },
  { path: "/store", name: "Store", component: Store },
  { path: "/food", name: "Food", component: Food },
  { path: "/", name: "Index", component: Index },
  {
    redirect: true,
    path: "/",
    pathTo: "/",
    name: "扶뒬못"
  }
];

export default indexRoutes;
